import React from "react";

import "./Pagination.css";

const PaginationSkeleton = () => {
  return (
    <div className="paginationBtns">
      {Array(5)
        .fill(1)
        .map((_, i) => (
          <button key={i} className="paginationBtn_skeleton"></button>
        ))}
    </div>
  );
};

export default PaginationSkeleton;
